import axios from "axios";
const apiUrl = "https://jadwalku-app.herokuapp.com/"

export const fetchListToDoById = (id) => {
    return (dispatch) => {
        return axios
            .get(`${apiUrl}/todos/${1}`)
            .then((response) => {
                dispatch(fetchSuccess(response.data));
                // console.log(response);

            })
            .catch((error) => {
                throw error;
            });
    };
};

export const fetchSuccess = (data) => {
    return {
        type: "GET_LIST",
        payload: {
            data,
        },
    };
};
